INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (101, 0.029, 0, 0, 160, 1, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 122601, 1.5, 110, 1, 1, 105, 1);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (102, 0.014, 0, 1, 120, 2, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 122401, 2.5, 105, 3, 0, 111, 2);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (103, 0.017, 1, 0, 350, 3, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 122501, 2.5, 110, 2, 0, 105, 3);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (104, 0.016, 0, 1, 130, 4, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 107501, 1.5, 110, 3, 0, 105, 4);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (105, 0.014, 0, 0, 160, 5, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 107601, 2.5, 110, 1, 1, 105, 5);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (106, 0.029, 1, 0, 255, 6, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 107801, 3.5, 120, 2, 0, 103, 6);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (107, 0.013, 0, 0, 160, 7, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 110601, 3.5, 120, 1, 1, 103, 7);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (108, 0.014, 1, 0, 350, 8, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 110401, 2.5, 110, 2, 0, 103, 8);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (109, 0.012, 0, 1, 130, 9, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 110501, 1.5, 105, 3, 0, 100, 9);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (110, 0.014, 0, 0, 200, 10, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 115701, 2.5, 105, 1, 1, 103, 10);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (111, 0.071, 1, 0, 350, 11, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 113601, 2.5, 105, 2, 0, 103, 11);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (112, 0.014, 0, 1, 130, 12, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 107901, 1.5, 120, 3, 0, 103, 12);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (113, 0.022, 0, 0, 200, 13, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 108001, 1.5, 110, 2, 1, 105, 13);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (114, 0.031, 0, 0, 160, 14, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 110301, 2.5, 110, 1, 1, 108, 14);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (115, 0.036, 0, 1, 130, 15, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 107701, 0.5, 110, 1, 0, 105, 15);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (116, 0.048, 1, 0, 350, 16, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 113101, 3.5, 110, 2, 0, 95, 16);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (117, 0.043, 0, 1, 130, 17, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 113301, 1.5, 105, 3, 0, 105, 17);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (118, 0.018, 0, 1, 130, 18, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 113201, 1.5, 105, 2, 0, 95, 18);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (119, 0.021, 0, 0, 160, 19, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 117001, 2.5, 110, 2, 1, 108, 19);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (120, 0.036, 1, 0, 255, 20, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 113501, 2.5, 110, 1, 0, 105, 20);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (121, 0.02, 1, 0, 350, 21, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 113401, 2.5, 105, 3, 0, 105, 21);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (122, 0.018, 0, 1, 130, 22, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 110101, 2.5, 110, 1, 0, 105, 22);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (123, 0.03, 0, 0, 160, 23, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 110001, 3.5, 105, 3, 1, 111, 23);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (124, 0.027, 0, 1, 130, 24, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 117201, 1.5, 110, 1, 0, 103, 24);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (125, 0.02, 0, 0, 160, 25, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 117301, 3.5, 105, 2, 1, 108, 25);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (126, 0.04, 1, 0, 350, 26, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 117401, 2.5, 110, 3, 0, 105, 26);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (127, 0.009, 1, 0, 350, 27, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 117101, 3.5, 110, 1, 0, 105, 27);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (128, 0.022, 1, 0, 255, 28, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 122901, 3.5, 120, 1, 0, 105, 28);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (129, 0.028, 0, 1, 130, 29, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 122801, 2.5, 110, 3, 0, 105, 29);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (130, 0.023, 0, 0, 130, 30, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 122701, 3.5, 105, 2, 1, 108, 30);
